import React from 'react';
import Header from '../Common/Header';
import ImgBackground from '../../assets/img/Group 2218.png';
import { borderRadius, height } from '@mui/system';

function MainImage() {
    return (
        <>
            <div class="main-image" style={{ backgroundColor: 'white'}}>
                <Header />
                <img style={{ width: '50%',marginLeft:'45%' ,height: '40vw', borderRadius:'10px'}} src={ImgBackground} alt="" />
                <div class="text">
                    <h1>Top Gun Maverick</h1> 
                    <p style={{ fontSize: '15px'}}>
                    Thirty years of service leads Maverick <br />
                     to train a group of elite TOPGUN graduates <br />
                      to prepare for a high-profile mission while Maverick <br />
                       battles his past demons.</p>


                   <a href="https://www.youtube.com/watch?v=lr_spVswTUo&vl=en" target="_blank"><button>Watch Now</button></a>
                </div>
            </div>
        </>
    );
}

export default MainImage;
